instance.peoplecode_text:
rem Uniqueid generation;
Local string &Uniqueid = UuidGen();

rem Getting from Config table;
Local string &dbname = %DbName;
Local string &domain = "KIMBLE";
Local string &config_name_linkserver = "LINKSERVER";
Local string &config_name_N_days_closed = "N_DAYS_CLOSED";

rem Populate staterecord to use Uniqueid across all the sections;
BB_KMBL_ACT_AET.UNIQUEID.Value = Upper(&Uniqueid);

rem Get values from configuration record;
SQLExec("select CONFIG_VALUE from PS_BB_CONFIG_REC where DOMAIN=:1 AND CONFIG_NAME=:2 AND DBNAME=:3", &domain, &config_name_linkserver, &dbname, &config_value_linkserver);
SQLExec("select CONFIG_VALUE from PS_BB_CONFIG_REC where DOMAIN=:1 AND CONFIG_NAME=:2", &domain, &config_name_N_days_closed, &config_value_N_days_closed);

MessageBox(0, "", 0, 0, "DBNAME: " | &dbname);
MessageBox(0, "", 0, 0, "Uniqueid: " | BB_KMBL_ACT_AET.UNIQUEID.Value);
MessageBox(0, "", 0, 0, "Linked server name: " | &config_value_linkserver);
MessageBox(0, "", 0, 0, "Closed Engagements: " | &config_value_N_days_closed);

rem Execute the stored procedure to load data into staging tables;
SQLExec("EXEC SFDC.SF_KIMBLE_ENGAGEMENT_GETDATA :1,:2,:3", &config_value_linkserver, BB_KMBL_ACT_AET.UNIQUEID.Value, &config_value_N_days_closed);

Local File &fileLog;
Local ApiObject &oSession, &oBbKmblActivityCi;
Local ApiObject &oProjActDescrCollection, &oProjActDescr;

Function errorHandler()
   Local ApiObject &oPSMessageCollection, &oPSMessage;
   Local number &i;
   Local string &sErrMsgSetNum, &sErrMsgNum, &sErrMsgText, &sErrType;

   &oPSMessageCollection = &oSession.PSMessages;
   For &i = 1 To &oPSMessageCollection.Count
      &oPSMessage = &oPSMessageCollection.Item(&i);
      &sErrMsgSetNum = &oPSMessage.MessageSetNumber;
      &sErrMsgNum = &oPSMessage.MessageNumber;
      &sErrMsgText = &oPSMessage.Text;
      &fileLog.WriteLine(&sErrType | " (" | &sErrMsgSetNum | "," | &sErrMsgNum | ") - " | &sErrMsgText);
   End-For;
   rem ***** Delete the Messages from the collection *****;
   &oPSMessageCollection.DeleteAll();
End-Function;


rem ***** Set the Log File *****;
&fileLog = GetFile("BB_KMBL_ACTIVITY_CI.log", "w", "a", %FilePath_Relative);
&fileLog.WriteLine("Begin");
&fileLog.WriteLine("Uniqueid" | " " | BB_KMBL_ACT_AET.UNIQUEID.Value);

Local Rowset &RS_ACTIVITY_STG = CreateRowset(Record.BB_ACTIVITY_STG);
&RS_ACTIVITY_STG.Fill("WHERE UNIQUEID=:1", BB_KMBL_ACT_AET.UNIQUEID.Value);
For &I = 1 To &RS_ACTIVITY_STG.ActiveRowCount
   try
      Local number &RS_BUSINESS_UNIT = &RS_ACTIVITY_STG(&I).BB_ACTIVITY_STG.BUSINESS_UNIT.Value;
      Local string &RS_PROJECT_ID = &RS_ACTIVITY_STG(&I).BB_ACTIVITY_STG.PROJECT_ID.Value;
      Local string &RS_ACTIVITY_ID = &RS_ACTIVITY_STG(&I).BB_ACTIVITY_STG.ACTIVITY_ID.Value;
      Local string &RS_ACT_DESCR = &RS_ACTIVITY_STG(&I).BB_ACTIVITY_STG.DESCR254.Value;


      rem ***** Get current PeopleSoft Session *****;
      &oSession = %Session;

      rem ***** Set the PeopleSoft Session Error Message Mode *****;
      &oSession.PSMessagesMode = 1;

      rem ***** Get the Component Interface *****;
      &oBbKmblActivityCi = &oSession.GetCompIntfc(CompIntfc.BB_KMBL_ACTIVITY_CI);
      If &oBbKmblActivityCi = Null Then
         errorHandler();
         throw CreateException(0, 0, "GetCompIntfc failed");
      End-If;

      rem ***** Set the Component Interface Mode *****;
      &oBbKmblActivityCi.InteractiveMode = True;
      &oBbKmblActivityCi.GetHistoryItems = True;
      &oBbKmblActivityCi.EditHistoryItems = True;

      rem ***** Set Component Interface Get/Create Keys *****;
      &oBbKmblActivityCi.BUSINESS_UNIT = &RS_BUSINESS_UNIT;
      &fileLog.WriteLine("__________________________");
      &fileLog.WriteLine(" BU =" | &oBbKmblActivityCi.BUSINESS_UNIT);
      &oBbKmblActivityCi.PROJECT_ID = &RS_PROJECT_ID;
      &fileLog.WriteLine("Project Id =" | &oBbKmblActivityCi.PROJECT_ID);
      &oBbKmblActivityCi.ACTIVITY_ID = &RS_ACTIVITY_ID;
      &fileLog.WriteLine("Activity Id =" | &oBbKmblActivityCi.ACTIVITY_ID);

      rem ***** Execute Get *****;
      If Not &oBbKmblActivityCi.Get() Then
         rem ***** No rows exist for the specified keys.*****;
         errorHandler();
         throw CreateException(0, 0, "Get failed");
      End-If;

      rem ***** Set/Get PROJ_ACT_DESCR Collection Field Properties -- Parent: PS_ROOT Collection *****;
      &oProjActDescrCollection = &oBbKmblActivityCi.PROJ_ACT_DESCR;
      Local integer &i1128;
      For &i1128 = 1 To &oProjActDescrCollection.Count;

         &oProjActDescr = &oProjActDescrCollection.Item(&i1128);
         &oProjActDescr.DESCR254 = &RS_ACT_DESCR;
         &fileLog.WriteLine("DESCR254 =" | &oProjActDescr.DESCR254);

      End-For;

      rem ***** Execute Save *****;
      If Not &oBbKmblActivityCi.Save() Then;
         errorHandler();
         throw CreateException(0, 0, "Save failed");
      End-If;

      rem ***** Execute Cancel *****;
      If Not &oBbKmblActivityCi.Cancel() Then;
         errorHandler();
         throw CreateException(0, 0, "Cancel failed");
      End-If;

   catch Exception &ex
      rem Handle the exception;
      &fileLog.WriteLine(&ex.ToString());
   end-try;

End-For;
&fileLog.WriteLine("End");
&fileLog.Close();
